const INITIAL_STATE = {
    subtemas: [
        {
            'id': 1,
            'texto': 'texto subtema 1'
        },
        {
            'id': 2,
            'texto': 'texto subtema 2'
        },
        {
            'id': 3,
            'texto': 'texto subtema 3'
        },
        {
            'id': 4,
            'texto': 'texto subtema 4'
        },
    ],
    lastId: 4
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_subtemas':
            return { ...state, subtemas: action.payload }
        case 'crear_subtema':
            return {
                ...state,
                subtemas: action.payload
            }
        case 'editar_subtema':
            return {
                ...state,
                subtemas: action.payload
            }
        case 'eliminar_subtema':
            return {
                ...state,
                subtemas: action.payload
            }
        default:
            return state;
    }
}
